  true,\n\t\"url\": null,\n\t\"notes\": \"SVS is a mainframe program that accesses
  the NUMIDENT to perform SSN verifications. This program is called by SSA Internal
  applications to verify SSNs. There is also an online version of the SVS program
  that verifies SSNs in real-time. The response codes differ from those returned by
  the Enumeration Verification System (EVS) while the matching routines and tolerances
  are exactly the same. The verification response codes that SVS returns to the system
  using it will be manipulated/interpreted according to that systems' own requirements.\",\n\t\"license_title\":
